con:configuration.scriptText:
import com.eviware.soapui.support.XmlHolder
def response = context.testCase.getTestStepByName('Create customer').getPropertyValue("Response")
def id = new XmlHolder(response)
def customerId = id.getNodeValue("//id")
log.info customerId
context.testCase.setPropertyValue("customerId",customerId)

